import React from "react";
import styles from "./Header.module.css";

const Header = () => {
  return (
    <div>
      <div className={styles.Header}></div>
      <div className={styles["main-image"]}>
      <img alt="hoeImage" src={require('../public/meals.jpg')} />
      </div>
    </div>
  );
};

export default Header;
